    }
  }

  render() {
    return (
      <Router>
        <div className="App">
          <Nav />
          <ScrollToTop>
            <Switch>
              <Route path="/" exact component={Home} />
              <Route path="/about" component={About} />
              <Route path="/terms" component={Terms} />
            </Switch>
          </ScrollToTop>
          <Footer />
        </div>
      </Router>
    );
  }
}

export default App;
